import React, { Component } from "react";

class FormR extends Component {
  render() {
    return (
      <div>
        <h1>Voting Registration Form</h1>
        <form>
         <label >
             Name
             <input type="text" />
         </label>
         <label >
             Id Number
             <input type="number" />
         </label>
         <label >
             Place
             <input type="text" />
         </label>
        </form>
      </div>
    );
  }
}

export default FormR;
